import './App.css';
import $ from 'jquery';
import img from './favicon.jpeg'

function App() {

  return (

    <div className="App">

      <div id="topnav">
      <img id="logo" src={img} ></img>

        <a>HOME</a>
        <a id="about-link">ABOUT</a>
        <a>CONTACT</a>
    </div>

    <h1 id="intro-main">
      Welcome to the Entrepreneurship Club of PES University E-City Campus!
    </h1>

    <div id="contact">
      <h1>Contact Us</h1>
      <p>The Entrepreneurship Club <br></br> PES University E-City Campus <br></br> Bangalore -560100</p>

    </div>







    </div>
  );
}

$("#about-link").click(function() {
  $('html,body').animate({
      scrollTop: $("#about").offset().top},
      'slow');
});



export default App;
